import React, { useState } from 'react';
import axios from 'axios';

const AddOrder: React.FC = () => {
  const [formData, setFormData] = useState({
    order_number: '',
    supplier: '',
    supplier_url: '',
    description: '',
    quantity: '',
    unit_price: '',
    currency: 'EUR',
    order_date: new Date().toISOString().split('T')[0],
    expected_delivery: '',
    notes: ''
  });
  const [message, setMessage] = useState('');
  const [error, setError] = useState('');

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    setMessage('');
    setError('');

    try {
      const token = localStorage.getItem('token');
      const res = await axios.post('/api/orders', {
        ...formData,
        quantity: parseInt(formData.quantity),
        unit_price: parseFloat(formData.unit_price),
        total_price: parseFloat(formData.unit_price) * parseInt(formData.quantity)
      }, {
        headers: { Authorization: `Bearer ${token}` }
      });

      setMessage('Bestelling succesvol toegevoegd!');
      setFormData({
        order_number: '',
        supplier: '',
        supplier_url: '',
        description: '',
        quantity: '',
        unit_price: '',
        currency: 'EUR',
        order_date: new Date().toISOString().split('T')[0],
        expected_delivery: '',
        notes: ''
      });
    } catch (err: any) {
      setError(err.response?.data?.error || 'Bestelling toevoegen mislukt');
    }
  };

  const handleChange = (e: React.ChangeEvent<HTMLInputElement | HTMLTextAreaElement | HTMLSelectElement>) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  return (
    <div style={{ padding: '20px', maxWidth: '600px', margin: '0 auto' }}>
      <h2>Nieuwe Bestelling</h2>
      <form onSubmit={handleSubmit}>
        <div style={{ marginBottom: '15px' }}>
          <label>Ordernummer *</label>
          <input
            type="text"
            name="order_number"
            value={formData.order_number}
            onChange={handleChange}
            required
            style={{ width: '100%', padding: '10px' }}
          />
        </div>

        <div style={{ marginBottom: '15px' }}>
          <label>Leverancier *</label>
          <input
            type="text"
            name="supplier"
            value={formData.supplier}
            onChange={handleChange}
            required
            style={{ width: '100%', padding: '10px' }}
          />
        </div>

        <div style={{ marginBottom: '15px' }}>
          <label>Leverancier URL</label>
          <input
            type="url"
            name="supplier_url"
            value={formData.supplier_url}
            onChange={handleChange}
            style={{ width: '100%', padding: '10px' }}
          />
        </div>

        <div style={{ marginBottom: '15px' }}>
          <label>Omschrijving *</label>
          <textarea
            name="description"
            value={formData.description}
            onChange={handleChange}
            required
            style={{ width: '100%', padding: '10px', height: '80px' }}
          />
        </div>

        <div style={{ display: 'flex', gap: '10px', marginBottom: '15px' }}>
          <div style={{ flex: 1 }}>
            <label>Aantal *</label>
            <input
              type="number"
              name="quantity"
              value={formData.quantity}
              onChange={handleChange}
              required
              min="1"
              style={{ width: '100%', padding: '10px' }}
            />
          </div>
          <div style={{ flex: 1 }}>
            <label>Prijs per stuk *</label>
            <input
              type="number"
              name="unit_price"
              value={formData.unit_price}
              onChange={handleChange}
              required
              min="0"
              step="0.01"
              style={{ width: '100%', padding: '10px' }}
            />
          </div>
          <div style={{ flex: 1 }}>
            <label>Valuta</label>
            <select
              name="currency"
              value={formData.currency}
              onChange={handleChange}
              style={{ width: '100%', padding: '10px' }}
            >
              <option value="EUR">EUR</option>
              <option value="USD">USD</option>
              <option value="CNY">CNY</option>
            </select>
          </div>
        </div>

        <div style={{ display: 'flex', gap: '10px', marginBottom: '15px' }}>
          <div style={{ flex: 1 }}>
            <label>Besteldatum *</label>
            <input
              type="date"
              name="order_date"
              value={formData.order_date}
              onChange={handleChange}
              required
              style={{ width: '100%', padding: '10px' }}
            />
          </div>
          <div style={{ flex: 1 }}>
            <label>Verwachte levering</label>
            <input
              type="date"
              name="expected_delivery"
              value={formData.expected_delivery}
              onChange={handleChange}
              style={{ width: '100%', padding: '10px' }}
            />
          </div>
        </div>

        <div style={{ marginBottom: '15px' }}>
          <label>Notities</label>
          <textarea
            name="notes"
            value={formData.notes}
            onChange={handleChange}
            style={{ width: '100%', padding: '10px', height: '60px' }}
          />
        </div>

        <button type="submit" style={{ width: '100%', padding: '10px', backgroundColor: '#28a745', color: 'white', border: 'none' }}>
          Bestelling Toevoegen
        </button>

        {message && <div style={{ color: 'green', marginTop: '10px' }}>{message}</div>}
        {error && <div style={{ color: 'red', marginTop: '10px' }}>{error}</div>}
      </form>

      <div style={{ marginTop: '20px' }}>
        <a href="/orders" style={{ color: '#007bff', textDecoration: 'none' }}>
          ‚Üê Terug naar Bestellingen
        </a>
      </div>
    </div>
  );
};

export default AddOrder;
